import React from 'react';

export const dummyChannels = [
    {
      id: 1,
      title: "test",
      avatarUrl: null,
      username: "Martin",
      isOnline: false,
    },
    {
      id: 2,
      title: "test1",
      avatarUrl: null,
      username: "Marta",
      isOnline: true,
    },
    {
      id: 3,
      title: "test2",
      avatarUrl: null,
      username: "Jack",
      isOnline: false,
    },
    {
      id: 4,
      title: "test3",
      avatarUrl: null,
      username: "Anna",
      isOnline: false,
    },
  ];

export const Channels = () => {
    return (
        <div className='channels-container'>
            Channels
        </div>
    );
};
